function handle_url(str){
    $re_string = "javascript:void(0);";
    if(str!=""){
        $re_string="http://"+str.replace('#dd#', '.dangdang.com/');
    }
    return $re_string ;
}
function is_have_sub(key){
    subnum = json_category[key].s.length ;
    subdate = json_category[key].s;
    for(i=0;i< subnum ;i++){
        subid = subdate[i] ;
        subcid = json_category[subid].s
        subnum1 = json_category[subid].s.length ;
        for(j=0;j< subnum1 ;j++){
            subsid = subcid[j];
            if(json_category[subsid].s && json_category[subsid].s.length>0){
               return 1;
            }
        }
    }
    return 0;
}
function is_have_right(key){
    if(json_category[key].th && json_category[key].th.length>0){
        return 1;
    }
    if(json_category[key].b && json_category[key].b.length>0){
        return 2;
    }
    if(json_category[key].g && json_category[key].g.length>0){
        return 3;
    }
    if(json_category[key].pi && json_category[key].pi.length>0){
        return 4;
    }
    return 0;
}
function new_diw_wdith(key,divobj){
    if(is_have_sub(key)){
        if(json_category[key].g==undefined && json_category[key].o==undefined){
            if(json_category[key].b==undefined && json_category[key].pr==undefined){
                divobj.style.width="520px";
            }
        }
    }else{
        if(!is_have_right(key)){
            divobj.style.width="160px";
        }else{
            divobj.className="pub_nav_pop narrow";
        }
    }
}

